import React, {Component} from 'react';

class Count extends Component {
    render() {
        return (
            <div>
                <h1>当前求和为0</h1>&nbsp
                <button>+</button>
                <button>-</button>
                <button>当前为奇数加</button>
                <button>异步加</button>
            </div>
        );
    }
}

export default Count;
